import axios from "../api/axios";
import {useState} from "react";
import '../css/join.css'
import Post from './Post';
function Join(){

    return (
    <div>            
                  <div>배송지</div>
                  <input
                    type="text"
                    id="postcode"
                    placeholder="우편번호"
                  />
                  <input
                    type="button"
                    onClick={handleComplete}
                    value="우편번호 찾기"
                  />
                  <br />
                  <input type="text" id="address" placeholder="주소" />
                  <br />
                  <input
                    type="text"
                    id="detailAddress"
                    placeholder="상세주소"
                  />
                  <input
                    type="text"
                    id="extraAddress"
                    placeholder="참고항목"
                  />
                  {/* {popup && (<Post></Post>)} */}
             
            </div>
           
    );
}
export default Join;
